import React from 'react';
import Link from 'next/link';
import { Menu, Input, Row, Col } from 'antd';

const AppLayout = ({ children }) => {
  return (
    <div>
      <Menu mode="horizontal">
        <Menu.Item>
          <Link href="/">
            <a>Home</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Link href="/profile">
            <a>프로필</a>
          </Link>
        </Menu.Item>
        <Menu.Item>
          <Input.Search enterButton style={{ verticalAlign: 'middle' }} />
        </Menu.Item>
        <Menu.Item>
          <Link href="/signup">
            <a>회원가입</a>
          </Link>
        </Menu.Item>
      </Menu>
      <Row>
        <Col
          xs={24}
          md={20}
          style={{ border: '1px solid blue', margin: '0 auto' }}
        >
          {children}
        </Col>
        {/* <Col xs={24} md={6} style={{ border: '1px solid pink' }}>
          오른쪽 메뉴
        </Col> */}
      </Row>
    </div>
  );
};

export default AppLayout;
